import React from 'react';
import logo from '../../assets/logo.png'
import search from '../../assets/search.svg'
import {Link} from 'react-router-dom';

import About from 'About'
import Products from 'Products'
import ForTeams from 'ForTeams'
const Navbar = () => {
    return (
        <nav>
            <div className='navbar'>
                <Link to = '/' className='nav-item nav-btn'><img src={logo} height='30px'alt="logo"/></Link>
                <Link to = '/About' className='nav-item nav-btn'>About</Link> 
                <Link to = '/Products' className='nav-item nav-btn'>Produts</Link> 
                <Link to = '/' className='nav-item nav-btn'>For Teams</Link> 

            <form>
                <input type ="text" placeholder ="Search..."/> <img src={search} alt ="search" />
            </form>
  </div>
        </nav>
    )
}
export default Navbar;
